import React from 'react';
import './index.css';

export const Error404 = () => {
  return (
    <>
    <div className="error">
        <h1>ERROR 404! Sorry Page not found....</h1>
        <p>the page you have requested is not currently available</p>
    </div>
    </>
  )
}
